import {
  Button,
  Popover,
  PopoverBody,
  PopoverHeader,
  UncontrolledPopover,
} from "reactstrap";
import Cart from "./cart";

export default function PopOver() {
  return (
    <div>
      <Button
        className=' mt-2'
        color='default'
        id='popover644119284'
        type='button'>
        Popover on top
      </Button>
      <UncontrolledPopover
        placement='top'
        target='popover644119284'>
        <PopoverBody
          style={{
            color: "var(--geist-background)",
            borderRadius: "var(--geist-radius)",
            width: 200,
            padding: "var(--geist-gap)",
            background: "var(--geist-foreground)",
          }}>
          <Cart />
        </PopoverBody>
      </UncontrolledPopover>
    </div>
  );
}
